en.administration.models.management.field.c:
Define additional restrictions for objects. 
Exapmle: 
{
"condition": "AND",
"rules":
[
{"field": "emf:status", "operator": "in", "type": "codeList", "value": ["ACTIVE"]}
,
{"field": "emf:departmentName", "operator": "in", "type": "codeList", "value": ["QAL", "SAL"]}
]
} - Objects with (User) object type, (Active) status and (Quality Department or Sales Department) department will be available for selection.
